const STREAM_APP_NAME = "UpdateBestseller";

const UPDATE_BESTSELLER_APP_DEFINITION = `@App:name("${STREAM_APP_NAME}")
@App:description("Updates BestsellerTable when a new order comes in the OrdersTable")

define function getBookQuantity[javascript] return int {
    const prevQuantity = arguments[0];
    const nextQuantity = arguments[1];
    
    let newQuantity = nextQuantity;
    if(prevQuantity){
        newQuantity = prevQuantity + nextQuantity;
    }
    return newQuantity;
};

@source(type='c8db', collection='OrdersTable', @map(type='passThrough'))
define stream OrdersTable (_json string);

@sink(type='c8streams', stream='BestsellerIntermediateStream', @map(type='json'))
define stream BestsellerIntermediateStream (bookId string, quantity int);

@store(type = 'c8db', collection='BestsellersTable')
define table BestsellersTable (_key string, quantity int);

select json:getString(jsonElement, '$.bookId') as bookId, json:getInt(jsonElement, '$.quantity') as quantity
from OrdersTable#json:tokenizeAsObject(_json, "$.books[*]")
insert into BestsellerIntermediateStream;

select next.bookId as _key, getBookQuantity(prev.quantity, next.quantity) as quantity
from BestsellerIntermediateStream as next
left outer join BestsellersTable as prev
on next.bookId == prev._key
update or insert into BestsellersTable
set BestsellersTable.quantity = quantity, BestsellersTable._key = _key
on BestsellersTable._key == _key;
`;

const formatDataForDynamo = (table) => {
  const attributeDefinitions = [
    {
      AttributeName: table.partitionKey,
      AttributeType: table.partitionKeyType,
    },
  ];

  const keySchema = [
    {
      AttributeName: table.partitionKey,
      KeyType: "HASH",
    },
  ];

  if (table.sortingKey) {
    attributeDefinitions.push({
      AttributeName: table.sortingKey,
      AttributeType: table.sortingKeyType,
    });

    keySchema.push({
      AttributeName: table.sortingKey,
      KeyType: "RANGE",
    });
  }

  return {
    TableName: table.name,
    KeySchema: keySchema,
    AttributeDefinitions: attributeDefinitions,
  };
};

const formatItem = (name, item) => {
  const formatItemData = (item) => {
    let itemObject = {};
    for (const key in item) {
      const valueType = typeof item[key];
      let type = "S";
      if (valueType === "boolean") {
        type = "BOOL";
      } else if (valueType === "number") {
        type = "N";
      } else if (valueType === "object") {
        if (Array.isArray(item[key])) {
          itemObject[key] = { L: [] };
          for (const subItem of item[key]) {
            itemObject[key]["L"].push({ M: { ...formatItemData(subItem) } });
          }
        } else {
          itemObject[key] = { M: {} };
          itemObject[key]["M"] = { ...formatItemData(item[key]) };
        }
      }
      if (valueType !== "object") {
        itemObject[key] = { [type]: item[key] };
      }
    }
    return itemObject;
  };

  const formattedItemObject = formatItemData(item);

  return {
    TableName: name,
    Item: formattedItemObject,
  };
};

const tableHandler = async (c8Client, dynamoClient, table) => {
  const { name, data } = table;
  const { TableNames } = await dynamoClient.listTables({});
  if (TableNames.includes(name)) {
    console.log(`${name} already exists. Skipping creation.`);
  } else {
    const coll = c8Client.collection(name);
    const exists = await coll.exists();
    if (!exists) {
      const tableCreationData = formatDataForDynamo(table);
      try {
        const response = await dynamoClient.createTable(tableCreationData);

        for (let item of data) {
          const formattedItem = formatItem(name, item);
          await dynamoClient.putItem(formattedItem);
        }
      } catch (error) {
        console.log(`Error while creating ${name} table`);
      }
    } else {
      console.log(
        "Collection already exists. Please delete the collection or change the table name."
      );
    }
  }
};

const collectionHandler = async (c8Client, collection) => {
  const { name, data } = collection;
  const coll = c8Client.edgeCollection(name);
  const exists = await coll.exists();

  const prefix = `Edge Collection ${name}`;
  console.log(`${prefix} exists=${exists}`);
  if (!exists) {
    await c8Client.createCollection(name, {}, true);
    console.log(`${prefix} created`);
    if (Array.isArray(data) && data.length)
      for (const edge of data) {
        await coll.save(data);
      }
    console.log(`Data inserted in ${prefix}`);
  } else {
    console.log(`${prefix} already exists. Skipping creation.`);
  }
  return coll;
};

async function init(c8Client, dynamoClient) {
  for (const table of Tables) {
    await tableHandler(c8Client, dynamoClient, table);
  }

  for (const edgeCollection of EDGE_COLLECTIONS) {
    await collectionHandler(c8Client, edgeCollection);
  }

  for (const graph of GRAPHS) {
    const { name, properties } = graph;
    const exists = await c8Client.hasGraph(name);
    if (!exists) {
      await c8Client.createGraph(name, properties);
      console.log(`Graph ${name} created`);
    } else {
      console.log(`Graph ${name} already exists. Skipping creation`);
    }
  }

  const response = await c8Client.getListOfViews();
  const existingViews = response.result;

  for (const view of VIEWS) {
    const { name, properties } = view;
    const exists = existingViews.find(
      (existingView) => existingView.name === name
    );
    if (exists) {
      console.log(`View ${name} exists. Skipping creation.`);
    } else {
      await c8Client.createView(name, properties);
      console.log(`View ${name} created.`);
    }
  }

  const res = await c8Client.getKVCollections();
  const existingKVCollections = res.result;
  for (const kvCollection of kvCollections) {
    const { name, data } = kvCollection;
    const exists = existingKVCollections.find(
      (existingColl) => existingColl.name === name
    );
    if (!exists) {
      await c8Client.createKVCollection(name);
      console.log(`KV Collection ${name} created`);
      if (Array.isArray(data) && data.length) {
        await c8Client.insertKVPairs(name, data);
        console.log(`Data inserted in ${name}`);
      }
    } else {
      console.log(`KV Collection ${name} already exists. Skipping creation.`);
    }
  }

  const dcList = DC_LIST.split(",");
  console.log("Checking stream app", JSON.stringify(dcList));
  try {
    const allStreamAppsRes = await c8Client.retrieveStreamApp();
    const existingStreamApps = allStreamAppsRes.streamApps;
    const streamAppExists = existingStreamApps.find(
      (streamApp) => streamApp.name === STREAM_APP_NAME
    );
    if (!streamAppExists) {
      await c8Client.createStreamApp(dcList, UPDATE_BESTSELLER_APP_DEFINITION);
      console.log(`Streamapp ${STREAM_APP_NAME} created.`);
      const app = c8Client.streamApp(STREAM_APP_NAME);
      await app.activateStreamApplication(true);
      console.log(`Streamapp ${STREAM_APP_NAME} activated.`);
    } else {
      console.log(
        `Streamapp ${STREAM_APP_NAME} already exists. Skipping creation.`
      );
    }
  } catch (e) {
    console.log("Error!!!");
    console.log(e);
  }
}

module.exports = init;

